var ball = this.getObjectByName( 'Ball' );

var position = ball.position;

var velocity = new THREE.Vector3();

var direction = new THREE.Vector3();
direction.x = Math.random() - 0.5;
direction.z = Math.random() - 0.5;
direction.normalize().multiplyScalar( 0.1 );

var pad1 = this.getObjectByName( 'Pad 1' );
var pad2 = this.getObjectByName( 'Pad 2' );

var raycaster = new THREE.Raycaster();
var objects = [ pad1, pad2 ];

//

function pointermove( event ) {

	pad1.position.z = ( event.clientX / player.width ) * 3 - 1.5;
	pad2.position.z = - pad1.position.z;

}

function update( event ) {

	if ( position.x < -3 || position.x > 3 ) direction.x = - direction.x;
	if ( position.z < -2 || position.z > 2 ) direction.z = - direction.z;

	position.x = Math.max( - 3, Math.min( 3, position.x ) );
	position.z = Math.max( - 2, Math.min( 2, position.z ) );

	raycaster.set( position, direction );

	var intersections = raycaster.intersectObjects( objects );

	if ( intersections.length > 0 ) {

		var intersection = intersections[ 0 ];

		if ( intersection.distance < 0.1 ) {

			direction.reflect( intersection.face.normal );

		}

	}

	position.add( velocity.copy( direction ).multiplyScalar( event.delta / 20 ) );

}
